  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100
  },
  gridList: {
    width: 750,
    height: 1000,
    paddingTop: 100,
    paddingLeft: 100,
  },
  text:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    minHeight: 1000,
  },
  title:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    position: "absolute",
    zIndex: 1
  },
  img:{
    height: 1000,
    width: 1
  }
}));
